import React, { ChangeEvent, useEffect, useState } from 'react';
import "@radix-ui/themes/styles.css";
import { Table, Box, Button, Flex, Avatar,  Skeleton, TextField } from '@radix-ui/themes';
import DropDownMenu from './DropdownMenu';
import { formatDate } from '../../util/formatDate';
import { User } from '../../types/User';
import PaginationButtons from '../PaginationButtons';
import { useUsers } from '../../hooks/api';
import SkeletonTable from '../SkeletonTable';
import { MagnifyingGlassIcon } from '@radix-ui/react-icons';


const UserTable: React.FC<any> = () => { 

    const [currentPage, setCurrentPage] = useState(1);
    const [hasNextPage, setHasNextPage] = useState(false);
    const [searchText, setSearchText] = useState("");
    const [debouncedSearch, setDebouncedSearch] = useState("");

    // I looked this up - I needed to submit by typing but get 
    // the table to pause reload until the user finishes their search
    // Adding a 300 ms timeour before the search text sets worked 
    useEffect(() => {
        const timer = setTimeout(() => {
            setDebouncedSearch(searchText);
        }, 300); 

        return () => clearTimeout(timer);
    }, [searchText]);

    const { data, isLoading, error } = useUsers(currentPage, debouncedSearch);

    const users = data?.completeUsers;

    const handleSearchChange = (e: ChangeEvent<HTMLInputElement>) => {
        setSearchText(e.target.value);
        // Reset to first page when searching
        setCurrentPage(1);
    };

     useEffect(() => {
        if (data) {
            // Check if there are more pages
            setHasNextPage(data.pages > currentPage);
            console.log("Data pages:", data.pages, "Current page:", currentPage);
        }
    }, [data, currentPage]);

    return (

        <>
             <Flex gap="2" my="24px" width="100%" justify-content="space-between">
                <Box width="100%">
                    <TextField.Root 
                        size="2" 
                        placeholder="Search by nameâ€¦"
                        value={searchText}
                        onChange={handleSearchChange}
                    >
                        <TextField.Slot>
                            <MagnifyingGlassIcon height="16" width="16" />
                        </TextField.Slot>
                    </TextField.Root>
                </Box>
                {/* Catie - This isn't exactly the right hex for the button - should be purple/9 or #6565EC */}
                <Button color="iris">
                    + Add User
                </Button>
            </Flex>

            <Box style={{ border: "2px solid var(--gray-a5)", borderRadius: "var(--radius-4)" }}>
                { isLoading ? 
                    <SkeletonTable /> :  

                <Table.Root>
                        <Table.Header style={{ background: "var(--gray-a2)" }}>
                            <Table.ColumnHeaderCell>User</Table.ColumnHeaderCell>
                            <Table.ColumnHeaderCell>Role</Table.ColumnHeaderCell>
                            <Table.ColumnHeaderCell>Joined</Table.ColumnHeaderCell>
                            <Table.ColumnHeaderCell />
                        </Table.Header>

                    <Table.Body>
                        {users?.map((user: User) => (
                            <Table.Row>
                                <Table.Cell>
                                    <Flex gap="2" align="center">
                                        <Avatar
                                            src={user.photo}
                                            fallback={user.first.charAt(0)}
                                            radius="full"
                                            size="2"
                                        />
                                        {user.first} {user.last}
                                    </Flex>
                                </Table.Cell>
                                <Table.Cell>
                                    {user.role.name}
                                </Table.Cell>
                                <Table.Cell>

                                    {formatDate(user.createdAt)}
                                    </Table.Cell>
                                <Table.Cell>
                                    <DropDownMenu user={user} />
                                </Table.Cell>
                            </Table.Row>
                        ))} 
                    </Table.Body>

                </Table.Root> 
}
                {data && data.pages > 1 && (
                    <PaginationButtons 
                        onPrevious={() => setCurrentPage(prev => Math.max(prev - 1, 1))}
                        onNext={() => setCurrentPage(prev => hasNextPage ? prev + 1 : prev)}
                        hasPrevious={currentPage > 1}
                        hasNext={hasNextPage} />
                )}


            </Box>
        </>

    )


}

export default UserTable;
